import React, { useEffect, useState } from "react";
import { BrowserRouter as Router, Routes, Route, Link } from "react-router-dom";
import Home from "./components/Home";
import UserManagement from "./components/UserManagement";
import ProductApiTester from "./components/ProductApiTester";
import ProductManagement from "./components/ProductManagement";
import SalesAnalytics from "./components/SalesAnalytics";
import Cart from "./components/Cart";
import Order from "./components/Order";
import Profile from "./components/Profile";
import ProductDetail from "./components/ProductDetail";
import Auth from "./components/Auth"; // Unified Login/Signup Component
import Login from "./components/Login";
import Signup from "./components/Signup";
import AboutUs from "./components/AboutUs";
import PrivacyPolicy from "./components/PrivacyPolicy";
import ReturnPolicy from "./components/ReturnPolicy";
import Reservations from "./components/Reservations";
import CheckoutFinish from './components/CheckoutFinish';
import PrivateRoute from "./components/PrivateRoute"; 
import "./App.css";

function App() {
  const [username, setUsername] = useState("");
  const [isLoggedIn, setIsLoggedIn] = useState(false);
  const [isAdmin, setIsAdmin] = useState(false);

  useEffect(() => {
    console.log("Testing API connection...");
    fetch("/api/test")
      .then((response) => response.json())
      .then((data) => console.log("Test endpoint response:", data))
      .catch((error) => console.error("Test endpoint error:", error));
  }, []);

  const handleLogin = (user) => {
    setUsername(user.username);
    setIsLoggedIn(true);
    setIsAdmin(user.isadmin === 1);
  };

  return (
    <Router>
      <div className="app-container">
        <header className="top-bar">
          <nav className="navigation">
            <ul>
              <li>
                <Link to="/">Home</Link>
              </li>
              {isAdmin && (
                <>
                  <li>
                    <Link to="/user-management">User Account Management</Link>
                  </li>
                  <li>
                    <Link to="/product-management">Product Management</Link>
                  </li>
                  <li>
                    <Link to="/sales-analytics">Sales Analytic Views</Link>
                  </li>
                </>
              )}
            </ul>
          </nav>
          <Link to="/" className="logo">
            BOOK<span className="yellow-dot"></span>COM
          </Link>
          <div className="user-actions">
           {/* Order History Button with Paper Icon */}
           <Link to="/order" className="order-history" title="Order History">
              <svg
                xmlns="http://www.w3.org/2000/svg"
                viewBox="0 0 24 24"
                fill="currentColor"
                width="24" // Adjust width to modify size
                height="24" // Adjust height to modify size
              >
                <path d="M19 3H5a2 2 0 0 0-2 2v14a2 2 0 0 0 2 2h14a2 2 0 0 0 2-2V5a2 2 0 0 0-2-2zM5 5h14v5H5V5zm0 7h6v2H5v-2zm0 4h6v2H5v-2zm8 2h6v2h-6v-2zm6-4h-6v-2h6v2z" />
              </svg>
            </Link>

            {/* Shopping Cart Button */}
            <Link to="/cart" className="shopping-cart" title="Shopping Cart">
              <svg
                xmlns="http://www.w3.org/2000/svg"
                viewBox="0 0 24 24"
                fill="currentColor"
                width="36" // Adjust width to modify size
                height="36" // Adjust height to modify size
              >
              <path d="M452.876,329.764H199.281l-94.205-248.28c-3.673-9.679-12.946-16.079-23.3-16.079H24.92C11.158,65.404,0,76.562,0,90.324 c0,13.763,11.158,24.92,24.92,24.92h39.659l94.205,248.279c3.673,9.679,12.946,16.079,23.3,16.079h18.06 c-0.907,3.946-1.403,8.047-1.403,12.265c0,30.177,24.55,54.727,54.727,54.727c30.176,0,54.727-24.55,54.727-54.727 c0-4.218-0.495-8.319-1.403-12.265h26.423c-0.907,3.946-1.403,8.047-1.403,12.265c0,30.177,24.55,54.727,54.727,54.727 c30.176,0,54.727-24.55,54.727-54.727c0-4.218-0.495-8.319-1.403-12.265h13.017c13.762,0,24.92-11.158,24.92-24.92 C477.797,340.92,466.64,329.764,452.876,329.764z M253.466,402.292c-5.747,0-10.424-4.676-10.424-10.424 c0-5.748,4.676-10.424,10.424-10.424c5.748,0,10.424,4.676,10.424,10.424C263.891,397.616,259.215,402.292,253.466,402.292z M386.537,402.292c-5.748,0-10.424-4.676-10.424-10.424c0-5.748,4.676-10.424,10.424-10.424c5.747,0,10.424,4.676,10.424,10.424 C396.96,397.616,392.284,402.292,386.537,402.292z"/>
             </svg>
            </Link>
            {isLoggedIn ? (
              <Link to="/profile" className="username">
                {username}
              </Link>
            ) : (
              <Link to="/auth" className="login-button" title="Login">
                Login
              </Link>
            )}
          </div>
        </header>

        <Routes>
          <Route
            path="/"
            element={<Home isLoggedIn={isLoggedIn} />}
          />
          <Route path="/product-api-tester" element={<ProductApiTester />} />
          <Route 
            path="/user-management" 
            element={<PrivateRoute isLoggedIn={isLoggedIn} isAdmin={isAdmin} element={<UserManagement />} />} 
          />
          <Route 
            path="/product-management" 
            element={<PrivateRoute isLoggedIn={isLoggedIn} isAdmin={isAdmin} element={<ProductManagement />} />} 
          />
          <Route 
            path="/sales-analytics" 
            element={<PrivateRoute isLoggedIn={isLoggedIn} isAdmin={isAdmin} element={<SalesAnalytics />} />} 
          />
          <Route path="/cart" element={<Cart username={username}/>} />
          <Route path="/order" element={<Order username={username}/>} />
          <Route path="/products/:id" element={<ProductDetail username={username} />} />
          <Route path="/reservations" element={<Reservations username={username}/>} />
          <Route path="/CheckoutFinish" element={<CheckoutFinish username={username} />} />
          
          {/* Auth routes - supporting both unified and separate components */}
          <Route
            path="/auth"
            element={
              <Auth
                setIsLoggedIn={setIsLoggedIn}
                setUsername={setUsername}
                setIsAdmin={setIsAdmin}
              />
            }
          />
          <Route
            path="/login"
            element={
              <Login
                setIsLoggedIn={setIsLoggedIn}
                setUsername={setUsername}
                setIsAdmin={setIsAdmin}
              />
            }
          />
          <Route path="/signup" element={<Signup />} />
          
          <Route
            path="/profile"
            element={
              <Profile
                username={username}
                setIsLoggedIn={setIsLoggedIn}
                setUsername={setUsername}
              />
            }
          />
          <Route path="/forgot-password" element={<div>Forgot Password Page</div>} />
          
          {/* Additional policy pages */}
          <Route path="/about-us" element={<AboutUs />} />
          <Route path="/privacy-policy" element={<PrivacyPolicy />} />
          <Route path="/return-policy" element={<ReturnPolicy />} />
        </Routes>
      </div>
    </Router>
  );
}

export default App;
